<?php/** * Renderer class for all In-Place Editor (IPE) behavior. */class panels_renderer_cns_ipe extends panels_renderer_ipe {  function get_url() {    $args = func_get_args();        $command = array_shift($args);    if ($command == 'select-content') {      $command = 'select-cns-content';    }        dsm($command);        $url = 'panels/ajax/' . $this->plugin['name'] . '/' . $command . '/' . $this->display->cache_key;    if ($args) {      $url .= '/' . implode('/', $args);    }            return $url;  }}